const char * parse_fs_dst ( struct trace_seq * p , const struct mlx5_flow_destination * dst , u32 counter_id ) { switch ( dst -> type ) { case MLX5_FLOW_DESTINATION_TYPE_UPLINK : trace_seq_printf ( p , "uplink\n" ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_VPORT : trace_seq_printf ( p , "vport=%u\n" , dst -> vport . num ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_FLOW_TABLE : trace_seq_printf ( p , "ft=%p\n" , dst -> ft ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_FLOW_TABLE_NUM : trace_seq_printf ( p , "ft_num=%u\n" , dst -> ft_num ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_TIR : trace_seq_printf ( p , "tir=%u\n" , dst -> tir_num ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_FLOW_SAMPLER : trace_seq_printf ( p , "sampler_id=%u\n" , dst -> sampler_id ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_COUNTER : trace_seq_printf ( p , "counter_id=%u\n" , counter_id ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_PORT : trace_seq_printf ( p , "port\n" ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_RANGE : trace_seq_printf ( p , "field=%s min=%d max=%d\n" , fs_dest_range_field_to_str ( dst -> range . field ) , dst -> range . min , dst -> range . max ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_TABLE_TYPE : trace_seq_printf ( p , "flow_table_type=%u id:%u\n" , dst -> ft -> type , dst -> ft -> id ) ; break ; case MLX5_FLOW_DESTINATION_TYPE_NONE : trace_seq_printf ( p , "none\n" ) ; break ; } trace_seq_putc ( p , 0 ) ; return ret ; } 